css:
.github-StubItem-git,
.github-Git-root {
  flex: 1;
  display: flex;
}
.github-Git {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", sans-serif;
  font-size: 14px;
  color: #d6d6d6;
  -webkit-user-select: none;
  cursor: default;
}
.github-Git.is-loading {
  color: #797979;
}
.github-Git.no-repository,
.github-Git.too-many-changes,
.github-Git.unsupported-directory {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
  padding: 42px;
  text-align: center;
}
.github-Git.no-repository > *,
.github-Git.too-many-changes > *,
.github-Git.unsupported-directory > * {
  margin: 14px 0;
}
.github-Git.no-repository h1,
.github-Git.too-many-changes h1,
.github-Git.unsupported-directory h1 {
  margin-bottom: 42px;
}
.github-Git.no-repository button,
.github-Git.too-many-changes button,
.github-Git.unsupported-directory button {
  overflow: hidden;
  text-overflow: ellipsis;
}
.github-Git-LargeIcon:before {
  margin-right: 0;
  margin-bottom: 70px;
  width: auto;
  height: auto;
  font-size: 8em;
  color: #5d5d5d;
}
